INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 102301, 10046, 24001, 2, 401, 2, "アヤネ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 2.21, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 102301, 10046, 24002, 2, 402, 1, "アヤネ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 102301, 10046, 24003, 2, 403, 2, "アヤネ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 1.99, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 192201, 10046, 24004, 1, 701, 2, "アサヒ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 2.21, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 192201, 10046, 24005, 2, 702, 1, "アサヒ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 3.33, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 192201, 10046, 24006, 1, 703, 2, "アサヒ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 192301, 10046, 24007, 2, 801, 2, "部員３", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 2.68, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 192301, 10046, 24008, 2, 802, 1, "部員３", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 192301, 10046, 24009, 2, 803, 2, "部員３", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "やった！", 192501, 10046, 24010, 1, 501, 1, "", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "勝ったよ！", 192501, 10046, 24011, 1, 502, 1, "", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "いい調子！", 192501, 10046, 24012, 1, 503, 1, "", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 5.33, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 113501, 10046, 24013, 2, 111, 6, "ミサト", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 6.85, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 113501, 10046, 24014, 2, 112, 1, "ミサト", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 3.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113501, 10046, 24015, 2, 113, 1, "ミサト", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 6.11, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 192401, 10046, 24016, 2, 611, 1, "ダイチ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 6.75, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 192401, 10046, 24017, 2, 612, 1, "ダイチ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 192401, 10046, 24018, 2, 613, 2, "ダイチ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 4.52, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 113401, 10046, 24019, 1, 211, 2, "ハツネ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 3.89, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 113401, 10046, 24020, 1, 212, 2, "ハツネ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 13.49, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 113401, 10046, 24021, 2, 213, 1, "ハツネ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 3.17, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 106501, 10046, 24022, 2, 311, 1, "カヤ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 4.42, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 106501, 10046, 24023, 2, 312, 1, "カヤ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 2.89, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 106501, 10046, 24024, 1, 313, 6, "カヤ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 3.71, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 102301, 10046, 24025, 3, 421, 4, "アヤネ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 5.1, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 192201, 10046, 24026, 1, 721, 2, "アサヒ", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 4.34, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 192301, 10046, 24027, 3, 821, 1, "部員３", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 192501, 10046, 24028, 1, 521, 1, "", 0.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 5.62, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 113501, 10046, 24029, 2, 101, 1, "ミサト", -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 9.58, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 113501, 10046, 24030, 2, 102, 1, "ミサト", -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 113501, 10046, 24031, 2, 103, 2, "ミサト", -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 9.13, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 113501, 10046, 24032, 1, 104, 2, "ミサト", -360.0);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, 24, 8.27, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 113501, 10046, 24033, 2, 105, 1, "ミサト", -360.0);
